Шифр вертикальной престановки - широко распространена разновидность шифра маршрутной перестановки, называемая ``шифром вертикальной перестановки'' (ШВП). В нем используется прямоугольник, в который сообщение вписывается обычным способом (по строкам слева направо). Выписываются буквы по вертикали, а столбцы при этом берутся в порядке, определяемом ключом.
Шифрование вертикальной перестановкой осуществляется следующим образом:
1) выбирается ключевое слово с неповторяющимися символами;
2) шифруемый текст записывается последовательными строками под символами ключевого слова;
3) зашифрованный текст выписывается колонками в порядке следования цифр в натуральном ряду.

Расшифрование выполняется в следующем порядке:
1) подсчитываем число знаков в зашифрованном тексте и делим на число знаков ключа;
